import React from 'react';
class ShoppingList extends React.Component {
    // constructor(props) {
    //     super(props);
    //     this.state = {
    //       value: 30,
    //     };
    //   }
    render() {
      return (
        <div className="shopping-list">
          <h1 >Shopping List for </h1>
          <ul>
            <li onClick={() => alert(this.props.name)}>Instagram</li>
            <li onclick={() => alert(this.props.age)}>WhatsApp</li>
            <li>Oculus</li>
          </ul>
        </div>
      );
    }
  }
  export default  ShoppingList;
